    "2016-07-27T22:44:26.380036",nt"name": "narrative-report-bear-river-migratory-bird-refuge-for-the-period-january-1-to-decembe-31-1",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Bear River
    Migratory Bird Refuge outlines Refuge accomplishments during the 1966 calendar year.
    The report begins by summarizing the weather conditions, habitat conditions, water
    conditions, and food and cover conditions during the year. Wildlife- including migratory
    birds, upland game birds, furbearers, predators, rodents, mammals, raptors, fish,
    reptiles, and diseases- is also covered. The Refuge development and maintenance
    section discusses physical developments, plantings, collections and receipts, vegetation
    control, prescribed burning, and wildfires. Resource management is outlined; topics
    include fur harvesting and commercial fishing. A progress report on field investigations
    and applied research is also provided. The public relations section of the report
    describes recreational uses, Refuge visitors, Refuge participation, hunting, violations,
    and safety. Items of interest, N-R forms, photographs, and newspaper articles are
